@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent {
  title = 'Menu';
}
<app-menu></app-menu>

<div class="my-5 py-5 bg-red-50">
  <h1 class="text-center py-5 font-bold text-8xl font-sans ">
    It is never too late <br>
    To Fall in love.
  </h1>
</div>
